const TableBody = (props) => {
  return (
    <>
      <tbody>
        {props.data.map((item) => {
          return (
            <>
              <tr>
                <td>{item.id}</td>
                <td>{item.first_name}</td>
                <td>{item.last_name}</td>
                <td>{item.handle}</td>
              </tr>
            </>
          );
        })}
      </tbody>
    </>
  );
};

export default TableBody;
